import React from "react";

const Footer = () => {
  return (
    <footer
      style={{
        backgroundColor: "#004080",
        color: "white",
        padding: "1rem 2rem",
        textAlign: "center",
        marginTop: "2rem",
        fontSize: "0.9rem",
      }}
    >
      © 2025 Nhà Hàng Hải Sản Việt Nam. Bản quyền thuộc về Hải Sản Việt Nam.
    </footer>
  );
};

export default Footer;
